import React, { useState, useEffect, useContext } from 'react';
import heartFull from './heartFull.png';
import heartEmpty from './heartEmpty.png';
// 0 = unliked
// 1 = liked

export function LikeButton() {
    const [likeState, changeLikeState] = useState(false);

    // useEffect(() => {
    //     document.title = `You clicked ${count} times`;
    // }, [likeState]);

    return (
    <div>
        <button onClick={() => changeLikeState(!likeState)}>
            { likeState ? <img src={heartEmpty} /> : <img src={heartFull} />}
        </button>
    </div>
    );
}
